import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './PeopleInAir.css';  // ðŸ‘ˆ make sure this file exists

export default function PeopleInAir() {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  const load = () => {
    axios.get('/api/people_in_air')
      .then(res => { setData(res.data); setError(null); })
      .catch(err => { setError(err.message); });
  };

  useEffect(() => { load(); }, []);

  return (
    <div className="container">
      <h2>People in the Air</h2>
      <button className="refresh-btn" onClick={load}>Refresh</button>
      {error && <p className="error">Failed to load: {error}</p>}

      <table className="people-table">
        <thead>
          <tr>
            <th>Flight</th>
            <th>Plane</th>
            <th>From</th>
            <th>To</th>
            <th>Airline</th>
            <th># Pilots</th>
            <th># Passengers</th>
            <th># Total</th>
            <th>Person List</th>
          </tr>
        </thead>
        <tbody>
          {data.map((entry, i) => (
            <tr key={i}>
              <td>{entry.flightID}</td>
              <td>{entry.tail_num}</td>
              <td>{entry.origin}</td>
              <td>{entry.destination}</td>
              <td>{entry.airlineID}</td>
              <td>{entry.num_pilots}</td>
              <td>{entry.num_passengers}</td>
              <td>{entry.joint_pilots_passengers}</td>
              <td>{entry.person_list}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
